import React from 'react';
import WalletConnect from './WalletConnect';

const Header = () => {
    // Prevent navigation on button click
    const handleWalletConnectClick = (event) => {
        event.preventDefault(); // Prevent the default anchor tag behavior
        console.log('Wallet Connect button clicked');
        // Add any additional logic you want to trigger on button click here
    };

    return (
        <header id="header">
            {/* Navbar */}
            <nav data-aos="zoom-out" data-aos-delay={800} className="navbar navbar-expand">
                <div className="container header">
                    <div className="ml-auto" />
                    {/* Navbar */}
                    <ul className="navbar-nav items mx-auto">
                        <li className="nav-item dropdown">
                            <a className="nav-link" href="/">Home</a>
                        </li>
                        <li className="nav-item dropdown">
                            <a className="nav-link" href="#">Live Auctions <i className="fas fa-angle-down ml-1" /></a>
                        </li>
                        <li className="nav-item">
                            <a href="/activity" className="nav-link">Create an Auction</a>
                        </li>
                        <li className="nav-item dropdown">
                            <a className="nav-link" href="#">Mint an NFT <i className="fas fa-angle-down ml-1" /></a>
                        </li>
                        
                        <li className="nav-item">
                            <a href="/contact" className="nav-link">Contact</a>
                        </li>
                    </ul>
                    {/* Navbar Icons */}
                    <ul className="navbar-nav icons">
                        <li className="nav-item">
                            <a href="#" className="nav-link" data-toggle="modal" data-target="#search">
                                <i className="fas fa-search" />
                            </a>
                        </li>
                    </ul>
                    {/* Navbar Toggler */}
                    <ul className="navbar-nav toggle">
                        <li className="nav-item">
                            <a href="#" className="nav-link" data-toggle="modal" data-target="#menu">
                                <i className="fas fa-bars toggle-icon m-0" />
                            </a>
                        </li>
                    </ul>
                    {/* Navbar Action Button */}
                    <ul className="navbar-nav action">
                        <li className="nav-item ml-3">
                            <a href="#" className="btn ml-lg-auto btn-bordered-white" onClick={handleWalletConnectClick}>
                                <i className="icon-wallet mr-md-2" />Wallet Connect
                            </a>
                        </li>
                    </ul>
                </div>
            </nav>
        </header>
    );
};

export default Header;
